import React, { Component } from 'react';
import NavBarItems from '../navbar/navBarItems';
import M from 'materialize-css';

class Header extends Component {
    componentDidMount(){
        M.Sidenav.init(this.sidenav);
    }
    render() {
        return (
            <header>
                <div className='navbar-fixed'></div>
                <nav role="navigation" className="amber darken-2">
                        <a href="/" className="brand-logo center">
                            <h2 className="nav-title-big">
                                {process.env.REACT_APP_NAME}
                            </h2>
                        </a>
                        <a href="#" data-target="slide-out" className="sidenav-trigger">
                            <i className="material-icons">menu</i>
                        </a>
                        <ul className="left hide-on-med-and-down">
                            <NavBarItems/>
                        </ul>
                </nav>
                <ul className="sidenav amber darken-2" ref={ (sidenav) => {this.sidenav = sidenav} } id="slide-out">
                    <li><a href="/"><h4 className='white-text'>{process.env.REACT_APP_NAME}</h4></a></li>
                    <li><div class="divider"></div></li>
                    <NavBarItems/>
                </ul>
            </header >
        );
    }
}

export default Header;
